import React, { useEffect } from 'react';
import './App.css';
import { Service } from './Service';

function App() {

  const [recipes, setRecipes] = React.useState([]);
  useEffect(() => {
    Service.getRecipes().then(data=>{
      setRecipes(data);
    })
  }) 
  return (
    <div className="App">

    </div>
  );
}

export default App;
